import React, { useEffect } from "react";
import {
  Button,
  Checkbox,
  FormControlLabel,
  Backdrop,
  CircularProgress,
  List,
  ListItem,
  ListItemAvatar,
  ListItemSecondaryAction,
  IconButton,
  Avatar,
  Chip,
} from "@material-ui/core";
import DeleteIcon from "@material-ui/icons/Delete";
import CommuteIcon from "@material-ui/icons/Commute";
import { useSelector } from "react-redux";
import { useHistory } from "react-router-dom";

import { Header } from "../Header";

export const BusquedaScreen = () => {
  const viajes = useSelector((state) => state.busqueda);
  const history = useHistory();
  console.log(viajes);

  useEffect(() => {
    if (viajes.length === 0) {
      history.push("/envio");
    }
  }, [viajes]);

  const setDireccion = (direccion) => {
    const newDir = direccion.split(",");
    return `${newDir[0]},${newDir[1]}`;
  };

  return (
    <>
      <Header />
      <div className="auth__container" style={{ marginTop: "20px" }}>
        <h1>Busqueda</h1>
        <div>
          <List style={{ width: "100%" }}>
            {viajes.map((viaje) => (
              <div>
                <ListItem button key={viaje.id}>
                  <ListItemAvatar>
                    <Avatar>
                      <CommuteIcon />
                    </Avatar>
                  </ListItemAvatar>
                  <div style={{ display: "flex", margin: "10px 0" }}>
                    <div style={{ margin: "0 8px" }}>
                      <p style={{ margin: "0 0 5px 0" }}>
                        {viaje.horaViaje} hrs {setDireccion(viaje.salida)}
                      </p>
                      <p style={{ margin: "5px 0 0 0" }}>
                        {viaje.hora_llegada} hrs {setDireccion(viaje.destino)}
                      </p>
                    </div>
                    <div style={{ display: "flex", alignItems: "flex-end" }}>
                      <p>${viaje.precio}</p>
                    </div>
                  </div>
                </ListItem>
                <div>
                  <Chip
                    label="Clickable"
                    deleteIcon={<DoneIcon />}
                    variant="outlined"
                    variant="outlined"
                  />
                </div>
              </div>
            ))}
          </List>
        </div>
      </div>
    </>
  );
};
